import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import SearchBooks from './SearchBooks';
import Login from './Login';

function App() {
  return (
    <Router>
      <div className="App">
        <h1 style={{ textAlign: 'center' }}>Milestone Library</h1>
        <div style={{ display: 'flex', justifyContent: 'space-between', padding: '10px' }}>
          <Login />
          <Link to="/searchBooks" style={{ alignSelf: 'flex-start' }}>
            <button style={{ padding: '10px 15px', border: 'none', backgroundColor: '#007bff', color: 'white', borderRadius: '5px' }}>
              Book Search
            </button>
          </Link>
        </div>
        <Switch>
          <Route path="/searchBooks" component={SearchBooks} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
